    "css_transform_tooltip": {                       "en": "Transformation that affects an element's appearance\x0AOnly visible, if widget is NOT selected.\x0AExamples: rotate(45deg) scale(0.5) skew(10deg)", "de": "Transformation, die das Aussehen eines Elements beeinflusst\x0ANur sichtbar, wenn das Widget NICHT ausgewählt ist.\x0ABeispiele: rotate(45deg) scale(0.5) skew(10deg)", "ru": "Трансформация, которая влияет на внешний вид элемента\x0AВидно только, если виджет НЕ выбран.\x0AПримеры: rotate(45deg) scale(0.5) skew(10deg)", "zh-cn": "顶部填充"},
