    "css_box-shadow": {                              "en": "box-shadow",                                      "de": "box-shadow",                                      "ru": "box-shadow",                                      "zh-cn": "阴影框"},
    "css_box-shadow_tooltip": {                      "en": "h-shadow v-shadow blur spread color\x0Ah-shadow: Required. The position of the horizontal shadow. Negative values are allowed,\x0Av-shadow: Required. The position of the vertical shadow. Negative values are allowed\x0Ablur: Optional. The blur distance\x0Aspread: Optional. The size of shadow\x0Acolor: Optional. The color of the shadow. The default value is black. Look at CSS Color Values for a complete list of possible color values.\x0Ainset: Optional. Changes the shadow from an outer shadow (outset) to an inner shadow.", "de": "inset [<X-Verschiebung> <Y-Verschiebung> <Unschärfe-Radius> <Ausbreitungsradius> <Farbe>]\x0Ainset: Die Angabe ist optional. Wenn nicht festgelegt, wird angenommen, dass es sich um einen Schlagschatten handelt.\x0AX-Verschiebung Y-Verschiebung: Eine Angabe ist erforderlich. Es gibt zwei Längenwerte, die die Verschiebung des Schattens angeben. Negative Werte sind auch möglich.\x0AUnschärfe-Radius: Die Angabe ist optional und Null, wenn kein <Unschärfe-Radius> gesetzt wurde. Je großer der Wert, desto größer die Unschärfe.\x0AAusbreitungsradius: Eine weitere Längenangabe, deren Angabe optional ist. Wenn nicht festgelegt ist der Ausbreitungsradius 0 und der Schatten hat die gleiche Größe wie das Element.\x0AFarbe: Die Angabe ist optional. Wenn nicht festgelegt, hängt die Farbe vom Browser ab. In Gecko (Firefox) wird der Wert der color Eigenschaft verwendet.", "ru": "inset <сдвиг по x> <сдвиг по y> <радиус размытия> <растяжение> <цвет>\x0Ainset: Тень выводится внутри элемента. Необязательный параметр.\x0Aсдвиг по x: Смещение тени по горизонтали относительно элемента. Положительное значение этого параметра задает сдвиг тени вправо, отрицательное — влево. Обязательный параметр.\x0Aсдвиг по y: Смещение тени по вертикали относительно элемента. Положительное значение задает сдвиг тени вниз, отрицательное — вверх. Обязательный параметр.\x0Aрадиус размытия: Задает радиус размытия тени. Чем больше это значение, тем сильнее тень сглаживается, становится шире и светлее. Если этот параметр не задан, по умолчанию устанавливается равным 0, тень при этом будет четкой, а не размытой.\x0Aрастяжение: Положительное значение растягивает тень, отрицательное, наоборот, ее сжимает. Если этот параметр не задан, по умолчанию устанавливается 0, при этом тень будет того же размера, что и элемент.\x0Aцвет: Цвет тени в любом доступном CSS формате, по умолчанию тень черная. Необязательный параметр.", "zh-cn": "h-shadow v-shadow模糊扩散颜色"},
